import React from 'react';

const PROJECTS = [
    { title: "Cheds club" },
    { title: "Commute NZ" },
    { title: "Sameageasmydog" },
    { title: "Prediciton Chicken" },
]

const Header = ({ height }) => (
    <div className="projects" style={{ height }}>
        { PROJECTS.map(project => (
            <div>
                <h2>
                    {project}
                </h2>
            </div>
        ))}
    </div>
)

export default Header;
